insert  into `tbl_dwdm_portlet`(`id`,`portlet`,`description`,`update_by`,`update_time`) values (1,'CM','<p><b>ข้อมูลในรายงานที่เกี่ยวกับ Interconnect ในเดือนสิงหาคม 2557 ไม่สามารถแสดงข้อมูลได้&nbsp;</b></p><p><b>เนื่องจากระบบต้นทาง Interconnect มีปัญหา ไม่สามารถจัดส่งข้อมูลให้ได้ ประกอบด้วยรายงาน 3 รายงาน ดังต่อไปนี้</b></p><p><br><p>CM-026 Outbound Analysis.srx<br><p></p><p><table height=\"1\" cellspacing=\"0\" cellpadding=\"0\" summary=\"\" border=\"0\"><tbody><tr><td class=\"treecellstyle\">CM-027 Inbound Analysis.srx</td></tr></tbody></table></p><p>CM-028 Transit Analysis.srx<br></p></p></p>','CM Admin','2014-09-24 10:20:21'),(2,'FI','Test FI','','2014-07-10 11:55:16'),(3,'HKR','Test HKR','','2014-07-04 11:30:48'),(4,'NUA','<img src=\"http://bis.cattelecom.com/images/login.png\" align=\"left\"><span style=\"color: rgb(34, 34, 34); font-family: Verdana, Arial, sans-serif; line-height: 14.300000190734863px; font-size: 11px;\">Mauris mauris ante, blandit et, ultrices a, suscipit eget, quam. Integer ut neque. Vivamus nisi metus, molestie vel, gravida in, condimentum sit amet, nunc. Nam a nibh. Donec suscipit eros. Nam mi. Proin viverra leo ut odio. Curabitur malesuada. Vestibulum a velit eu ante scelerisque vulputate.</span><p></p><p style=\"color: rgb(0, 0, 0); font-family: Tahoma, Arial; font-size: 12px; margin-left: 30px;\"></p>','Administrator','2014-07-04 11:30:59'),(5,'test','TEST PORTLET','Administrator','2014-09-10 14:24:12');

/*Table structure for table `tbl_dwdm_problems` */

DROP TABLE IF EXISTS `tbl_dwdm_problems`;

