insert  into `tbl_dwdm_problems`(`id`,`cate_id`,`problem_status`,`problem_date_start`,`problem_topic`,`problem_owner`,`problem_by`,`problem_solution`,`problem_date_finish`,`problem_remark`,`update_time`,`update_by`) values (1,2,'P','2014-05-20 10:00:00','บ.นำเครื่อง B2 ไปทดสอบติดตั้งโปรแกรม HP Data Protector Version 8.0 เพื่อ Backup ข้อมูลแทนเครื่อง Backup เดิมที่ติดตั้ง Version 6 เพื่อให้สามารถ Backup OS ได้','นายปิยะพงษ์ แก้วน่าน','IRCP','เพิ่ม \r\n- MEMSORT = 8G','2014-08-12 08:30:00',NULL,'2014-09-24 11:50:23','Administrator'),(2,2,'S','2014-06-02 11:37:00','เครื่อง Server CATDEV2 ไม่สามารถ Build Cube ได้','นายณัฐวัฒน์ แสงสีทอง','บ.IRCP','เนื่องจากค่า Config ที่ Path /app/sas/config/Lev1/SASBI/OLAPServer/sasv9.cfg ที่เครื่อง CATDEV2 (OLAP Server) ได้ชี้ Service ไม่ถูกต้อง แก้ไขค่า \"SASMiner - OLAP Server\" -> \"SASBI - OLAP Server\"','2014-06-09 20:00:00',NULL,'2014-09-24 11:50:27','Administrator'),(3,2,'S','2014-06-03 11:39:00','แจ้ง บ.ติดตั้ง Flow Manager Server ที่เครื่อง CATDE1,CATDEV2','น.ส.ภัทริกา แก้วใจ','คุณคมสันฯ (IRCP)','ติดตั้ง Flow Manager Server ','2014-06-23 11:51:00',NULL,'2014-09-24 11:50:33','Administrator'),(4,2,'P','2014-06-13 11:41:00','บ. แจ้งเข้ามาเพื่อตั้งค่า Mail Alert ใน Flows ของ 3 โมดูล (CM,NUA,HKR)','คุณคมสันฯ ,คุณพลอยสินฯ (Innobiz)','','','1970-01-01 07:00:00',NULL,'2014-09-24 11:50:02','นายปิยะพงษ์ แก้วน่าน'),(5,1,'S','2014-06-18 08:30:00','แจ้งสลับ Path /ftproot กับ /temp ที่เครื่อง CATDEV1 เนื่องจากในเครื่อง CATDEV1 ที่ Path /ftproot (100GB) มีเนื้อที่ใช้งานเหลือไม่มาก ','นายปิยะพงษ์ แก้วน่าน','คุณธัชพลฯ IRCP','ทำการสลับ Path ftproot กับ /temp ที่เครื่อง CATDEV1 ','2014-07-01 08:30:00',NULL,'2014-09-23 16:19:11','Administrator'),(6,2,'S','2014-06-30 08:30:00','บ.แจ้ง Stop SAS Service เพื่อทำการ Update SAS License','คุณคมสันฯ (Innobiz)','คุณคมสันฯ (Innobiz)',' - Stop Process & Service ต่างๆ ของ SAS เพื่อทำการ update license SAS & Process manager ที่เครื่อง\r\n10.32.13.21     cateai1                        \r\n10.32.13.16     catebi1                        \r\n10.32.13.26     catedi1                        \r\n10.32.13.52     catspm             \r\n10.32.13.46     catspm1                         \r\n10.32.13.24     catdev1                       \r\n10.32.13.25     catdev2                       \r\n10.32.13.48     catbsc              \r\n10.32.13.45     catbsc1                        \r\n10.32.13.11     catspds1','2014-07-01 08:30:00',NULL,'2014-09-24 11:50:34','Administrator'),(7,2,'S','2014-07-01 08:30:00','ไม่สามารถใช้งานโปรแกรม Flow Manager เชื่อมต่อไปที่เครื่อง CATEDI1 ได้ เกิดจากการที่ process ของ process manager ยังคงตกค้างแม้จะใช้ script jadmin stop ทำให้ เมื่อ start ขึ้นมาอีกครั้งจะเกิด fail  port ชนกัน\r\nError : Error Communicating with Daemon: Invalid response - Unable to connect to Process Manager <catedi1:1966>.','นายปิยะพงษ์ แก้วน่าน','คุณคมสันฯ (Innobiz)','วิธีแก้ไข :\r\nทำการ kill process jfd ทิ้ง แล้ว start service ใหม่','2014-07-01 10:40:00',NULL,'2014-09-24 11:50:36','Administrator'),(8,2,'S','2014-07-23 10:00:00','ไม่สามารถเชื่อมต่อ Server ได้\r\nเนื่องจากในเวลา 11.00 น. ของวันนี้ ทางทีม Network ของ CAT (พี่พรเทพ)\r\nได้เริ่มเปิดใช้งาน firewall เพื่อ กำหนด Policy การเข้าถึง Server DW/DM โดยได้ทำการ Allow Port ในการเข้าใช้งาน Server \r\nซึ่งยังขาด Port 1966 (Flow Manager) , 8591 (Connect Server) ทำให้ไม่สามารถเชื่อมต่อ Server ได้\r\nThe application could not log on to the server \"catedi1:8591\". No server is available at that port on that machine.\r\nConnection timed out: connect','นายณัฐวัฒน์ แสงสีทอง','นายพรเทพฯ นธ.','แจ้ง Port ต้องใช้งานเพิ่มเติมกับทาง นธ.','2014-07-23 14:30:00',NULL,'2014-09-24 11:50:37','Administrator'),(9,2,'S','2014-07-28 11:40:00','Jobs ไม่สามารถส่งเมล์ได้หลังจากทำงานเสร็จ เกิดจากการ Config ค่า Mail ไม่ถูกต้อง\r\nERROR: Email: The connection has timed out.','นายณัฐวัฒน์ แสงสีทอง','คุณธัชพลฯ IRCP','แก้ไขค่า Config ที่ Server CATEDI1,CATEBI1 แล้ว Restart Service Mail','2014-08-19 07:00:00',NULL,'2014-09-24 11:50:39','Administrator'),(10,2,'S','2014-07-30 09:20:00','ERROR: Sort Execution Failure เมื่อรันจ๊อบที่ SAS DI หรือ Process Manager ที่เครื่อง Production (เครื่อง Dev ไม่มีปัญหา)  เจอปัญหาเกิด Node ที่มีการ Sort','นายณัฐวัฒน์ แสงสีทอง','คุณคมสันฯ (inobiz)','วิธีแก้ไข :\r\nเพิ่ม parameter ที่  /app/sas/config/Lev1/SASDI/WorkspaceServer/sasv9.cfg ดังนี้\r\n-MEMSIZE 8G\r\n-SORTSIZE 4G\r\nrestart services ทั้งหมดของเครื่อง catedi1\r\n\r\n - แจ้ง บ. 30 ก.ค. 57 เวลา 14.13 น.\r\nอธิบายเพิ่มเติม\r\nในแต่ละ component (BatchServer, OLAPServer, WorkspaceServer) ที่อยู่ภายใต้พาธ/app/sas/config/Lev1/SASDI/  จะมี config ของใครของมัน\r\nเช่น /app/sas/config/Lev1/SASDI/BatchServer/sasv9.cfg\r\nถ้ามีการใส่ Optionเพิ่มจะเป็นการเขียนทับ(Override) Config File ตัวหลักซึ่งอยู่ที่ /app/sas/software/SASFoundation/9.2/sasv9.cfg ซึ่งเซตค่า MEMSIZE=8G และ SORTSIZE=2G\r\nการรันด้วย SASDI จะใช้  /WorkspaceServer/sasv9.cfg\r\nการรันด้วย Process Manager จะใช้  /BatchServer/sasv9.cfg\r\nการที่เซต parameter ที่ Workspace จะ Override ตัว Batchserver ด้วย จึงทำให้รันจ๊อบจากทั้ง 2 program ไม่ Error','2014-08-07 16:20:00',NULL,'2014-09-24 11:50:46','Administrator'),(11,1,'S','2014-08-07 15:40:00','Cache Board ที่เครื่อง Storage P12000 พัง 1 ตัว\r\nบ. แจ้งว่าอยู่ในช่วงการต่อ MA จะทำให้ HP อาจคิดค่าปรับย้อนหลังได้','คุณธัชพลฯ IRCP','คุณธัชพลฯ IRCP','แจ้ง HP Thailand เปลี่ยนอุปรณ์','2014-08-28 09:30:00',NULL,'2014-09-23 16:19:12','Administrator'),(12,1,'S','2014-08-21 10:00:00','ไม่สามารถเชื่อมต่อ Server เครื่อง CATEDI1 ได้ (10.00 น.) RAM พัง','นายปิยะพงษ์ แก้วน่าน','คุณธัชพลฯ IRCP','แจ้ง HP Thailand เปลี่ยนอุปรณ์','2014-08-28 09:30:00',NULL,'2014-09-23 16:19:12','Administrator'),(13,1,'S','2014-09-08 10:00:00','เครื่อง Server Superdome มีไฟล์เตือนขึ้น คุณฟอร์ดฯแจ้ง HP เพื่อเข้ามาตรวจสอบในวันที่ 9 ก.ย. 57 เวลา 10.00 น. ','คุณธัชพลฯ IRCP','HP Thailand,IRCP','เปลี่ยน RAM เครื่อง CATEAI1 โดย HP Thailand','2014-09-09 13:00:00',NULL,'2014-09-23 16:19:13','นายปิยะพงษ์ แก้วน่าน'),(14,2,'S','2014-09-30 11:00:00','/work ใน CATDEV2 เต็ม ทำให้ service down','นายธรรมรัฐฯ','บ.Innobiz (คมสันฯ)','ทำการ Clear /work แล้ว Restart Service ใหม่','2014-09-30 14:30:00',NULL,'2014-10-02 15:24:34','นายปิยะพงษ์ แก้วน่าน'),(15,2,'P','2014-09-23 16:00:00','1.SAS LOGS\r\n      1.1	 ทาง CAT ต้องการทราบจำนวนผู้เข้าใช้งานระบบทั้งผ่าน Web และ Apps ต่างๆ ว่าในแต่ละเดือนมีสถิติการใช้งานมากน้อยเพียงใด? \r\nสามารถเรียกดูสถิติเหล่านี้ได้จากที่ไหน?\r\n      1.2	 การเปิดใช้งาน Audit Logs ของโปรแกรม SAS เพื่อเก็บ Logs มีวิธีการอย่างไร? และเมื่อเปิดแล้ว Logs ที่ต้องการดูตามข้อ (1) นั้น\r\nข้อมูล Logs อยู่ที่ไหน?  และมีผลต่อประสิทธิภาพการทำงานของเครื่องมากน้อยเพียงใด?\r\n\r\n2.	Graph ของ SAS บน Web report\r\n      2.1	 ปัญหา Graph บน Web Report แสดงข้อความบนกราฟ (Label) ซ้อนทับกันสามารถแก้ไขไม่ซ้อนกันได้หรือไม่? อย่างไร?\r\n      2.2	 กราฟสีไม่สวย ปรับเปลี่ยนสีได้มั้ย?\r\n','นายปิยะพงษ์ แก้วน่าน','','','2014-10-02 15:31:00',NULL,'2014-10-02 15:32:51','นายปิยะพงษ์ แก้วน่าน');

