.sas.com/images/samples/about.gif\" id=\"tabnav_about\" style=\"margin-right: 0px; margin-bottom: 0px; padding: 0px; border: none; font-size: 13px; line-height: 1.25em; font-family: inherit;\"></a></td><td><a href=\"http://support.sas.com/kb/44/788.html#\" style=\"margin: 0px; padding: 0px; border: 0px; font-size: 13px; line-height: 1.25em; font-family: inherit; text-decoration: none; color: rgb(0, 102, 204);\"><img border=\"0\" alt=\"Rate It\" src=\"http://support.sas.com/images/samples/rateit.gif\" id=\"tabnav_rateit\" style=\"margin-right: 0px; margin-bottom: 0px; padding: 0px; border: none; font-size: 13px; line-height: 1.25em; font-family: inherit;\"></a></td><td width=\"100%\" height=\"3\" valign=\"bottom\"><img width=\"100%\" alt=\"\" height=\"3\" src=\"http://support.sas.com/images/samples/gray1.gif\" style=\"margin-right: 0px; margin-bottom: 0px; padding: 0px; border: 0px; font-size: 13px; line-height: 1.25em; font-family: inherit;\"></td></tr></tbody></table><p id=\"tab_details\" style=\"font-family: Arial, Helvetica, Verdana, sans-serif; font-size: small; line-height: 16.899999618530273px; padding: 10px 0px 0px 30px;\">The following error message might be displayed when you invoke Microsoft Office with SAS Add-In for Microsoft Office installed.<p style=\"margin-bottom: 0px; padding: 5px 0px; border: 0px; font-size: 13px; line-height: 1.25em; font-family: inherit;\"></p><p style=\"margin-bottom: 0px; padding: 5px 0px; border: 0px; font-size: 13px; line-height: 1.25em; font-family: inherit;\"><img src=\"http://support.sas.com/kb/44/addl/fusion_44788_1_rootelement1.jpg\" alt=\"image label\" style=\"margin-right: 0px; margin-bottom: 0px; padding: 0px; border: 0px; font-size: 13px; line-height: 1.25em; font-family: inherit;\"></p><p style=\"margin-bottom: 0px; padding: 5px 0px; border: 0px; font-size: 13px; line-height: 1.25em; font-family: inherit;\"></p><p style=\"margin-bottom: 0px; padding: 5px 0px; border: 0px; font-size: 13px; line-height: 1.25em; font-family: inherit;\">Clicking the <b>Details</b> button shows additional information, as shown below.</p><p style=\"margin-bottom: 0px; padding: 5px 0px; border: 0px; font-size: 13px; line-height: 1.25em; font-family: inherit;\"></p><p style=\"margin-bottom: 0px; padding: 5px 0px; border: 0px; font-size: 13px; line-height: 1.25em; font-family: inherit;\"><img src=\"http://support.sas.com/kb/44/addl/fusion_44788_3_rootelement3.jpg\" alt=\"image label\" style=\"margin-right: 0px; margin-bottom: 0px; padding: 0px; border: 0px; font-size: 13px; line-height: 1.25em; font-family: inherit;\"></p><p style=\"margin-bottom: 0px; padding: 5px 0px; border: 0px; font-size: 13px; line-height: 1.25em; font-family: inherit;\"></p><p style=\"margin-bottom: 0px; padding: 5px 0px; border: 0px; font-size: 13px; line-height: 1.25em; font-family: inherit;\">The error might occur because of a corrupt AMOOptions.xml file. In that case, renaming the AMOOptions.xml file should correct the problem.</p><ol><li style=\"line-height: 20px;\">Close Microsoft Office.</li><li style=\"line-height: 20px;\">Browse to the following location depending on your operating system and rename the AMOOptions.xml file to AMOOptions_old.xml.<ul style=\"margin: 0px 0px 20px; padding: 0px 0px 0px 25px;\"><li>Windows XP path to AMOOptions.xml: <br><span style=\"font-family: monospace;\"><b>C:\\Documents and Settings\\<userid>\\Application Data\\SAS\\Add-InForMicrosoftOffice\\4.3</b></span></li><li>Windows 7 path to AMOOptions.xml: <br><span style=\"font-family: monospace;\"><b>C:\\Users\\<userid>\\AppData\\Roaming\\SAS\\Add-InForMicrosoftOffice\\4.3</b></span></li></ul></li></ol><p style=\"margin-bottom: 0px; padding: 5px 0px; border: 0px; font-size: 13px; line-height: 1.25em; font-family: inherit;\"><b>Note:</b> The paths shown above use the default Windows profile path for the respective operating system. Your Windows profile path might be different. If your profile path is other than the default, open <b>My Computer</b> and enter <b>%appdata%</b> in the address bar to determine what your Windows profile path is. <br><br></p><h4 style=\"margin-top: 1em; margin-bottom: 0px; padding: 0px 0px 1px; border: 0px; font-size: 1em; line-height: 1.25em; font-family: inherit; color: rgb(0, 0, 0);\">Operating System and Release Information</h4><table cellpadding=\"5\" border=\"1\" style=\"font-size: 13px; line-height: 1.25em; font-family: inherit; padding: 5px 0px;\"><tbody style=\"font-size: 13px; line-height: 1.25em; font-family: inherit;\"><tr class=\"product_header\" style=\"font-weight: bold; font-size: 13px; line-height: 1.25em; font-family: inherit; text-align: center; background-color: rgb(204, 204, 204);\"><td rowspan=\"2\">Product Family</td><td rowspan=\"2\">Product</td><td rowspan=\"2\">System</td><td colspan=\"2\" style=\"background-color: rgb(236, 236, 236);\">Product Release</td><td colspan=\"2\" style=\"background-color: rgb(236, 236, 236);\">SAS Release</td></tr><tr class=\"product_header\" style=\"font-weight: bold; font-size: 13px; line-height: 1.25em; font-family: inherit; text-align: center; background-color: rgb(204, 204, 204);\"><td>Reported</td><td>Fixed*</td><td>Reported</td><td>Fixed*</td></tr><tr class=\"product_row\" style=\"font-size: 13px; line-height: 1.25em; font-family: inherit; text-align: center;\"><td valign=\"top\" rowspan=\"9\">SAS System</td><td valign=\"top\" rowspan=\"9\">SAS Add-in for Microsoft Office</td><td>Microsoft® Windows® for x64</td><td>4.305</td><td>6.1</td><td>9.2 TS2M0</td><td>9.3 TS1M2</td></tr><tr class=\"product_row\" style=\"font-size: 13px; line-height: 1.25em; font-family: inherit; text-align: center;\"><td>Microsoft Windows Server 2003 Datacenter Edition</td><td>4.305</td><td>6.1</td><td>9.2 TS2M0</td><td>9.3 TS1M2</td></tr><tr class=\"product_row\" style=\"font-size: 13px; line-height: 1.25em; font-family: inherit; text-align: center;\"><td>Microsoft Windows Server 2003 Enterprise Edition</td><td>4.305</td><td>6.1</td><td>9.2 TS2M0</td><td>9.3 TS1M2</td></tr><tr class=\"product_row\" style=\"font-size: 13px; line-height: 1.25em; font-family: inherit; text-align: center;\"><td>Microsoft Windows Server 2003 Standard Edition</td><td>4.305</td><td>6.1</td><td>9.2 TS2M0</td><td>9.3 TS1M2</td></tr><tr class=\"product_row\" style=\"font-size: 13px; line-height: 1.25em; font-family: inherit; text-align: center;\"><td>Microsoft Windows Server 2003 for x64</td><td>4.305</td><td>6.1</td><td>9.2 TS2M0</td><td>9.3 TS1M2</td></tr><tr class=\"product_row\" style=\"font-size: 13px; line-height: 1.25em; font-family: inherit; text-align: center;\"><td>Microsoft Windows Server 2008 for x64</td><td>4.305</td><td>6.1</td><td>9.2 TS2M0</td><td>9.3 TS1M2</td></tr><tr class=\"product_row\" style=\"font-size: 13px; line-height: 1.25em; font-family: inherit; text-align: center;\"><td>Microsoft Windows XP Professional</td><td>4.305</td><td>6.1</td><td>9.2 TS2M0</td><td>9.3 TS1M2</td></tr><tr class=\"product_row\" style=\"font-size: 13px; line-height: 1.25em; font-family: inherit; text-align: center;\"><td>Windows Vista</td><td>4.305</td><td>6.1</td><td>9.2 TS2M0</td><td>9.3 TS1M2</td></tr><tr class=\"product_row\" style=\"font-size: 13px; line-height: 1.25em; font-family: inherit; text-align: center;\"><td>Windows Vista for x64</td><td>4.305</td><td>6.1</td><td>9.2 TS2M0</td><td>9.3 TS1M2</td></tr></tbody></table><span class=\"status\" style=\"color: rgb(0, 0, 0); font-weight: bold;\"><b>*</b></span><span class=\"newstext\" style=\"font-size: 10px; line-height: normal; color: rgb(0, 0, 0); margin-top: 0px; padding-top: 0px;\"> For software releases that are not yet generally available, the Fixed Release is the software release in which the problem is planned to be fixed.</span></p>','Y',0,'2014-07-16 14:23:41','Administrator'),(10,2,'Download SAS Install ที่ไหน','ที่เครื่อง B3','Y',0,'2014-08-08 10:34:19','Administrator'),(11,1,'How to Create Graph Using SAS Enterprise Guide','<table width=\"100%\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" background=\"http://web.utk.edu/sas/OnlineTutor/1.2/en/60477/navimages/banner.gif\"><tbody><tr valign=\"top\" bgcolor=\"#FFFFF0\"><td valign=\"middle\" style=\"font-size: 13px;\"><font color=\"#003399\" size=\"3\" face=\"Arial, Helvetica, sans-serif\"><b>Creating Graphs</b></font></td><td style=\"font-size: 13px;\"><img src=\"http://web.utk.edu/sas/OnlineTutor/1.2/en/60477/navimages/arch.gif\" width=\"357\" height=\"64\" align=\"top\" alt=\" \" style=\"cursor: pointer;\"></td></tr></tbody></table><br style=\"color: rgb(0, 0, 0); font-size: 13px;\"><center style=\"color: rgb(0, 0, 0); font-size: 13px;\"><p id=\"le2_eg2\" class=\"eg_div\"></p><table width=\"85%\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\"><tbody><tr valign=\"top\"><td style=\"font-size: 13px;\"><p>Now that you\'ve created a list report, a frequency report, and a summary table, let\'s look at the last type of report that you need: a <b>graph</b> that shows total profit by product category. To create this graph, you can produce a simple bar chart in only a few steps.</p></td></tr></tbody></table><p><br></p><p id=\"eg2\" class=\"eg_div\"><img src=\"http://web.utk.edu/sas/OnlineTutor/1.2/en/60477/m102/images/m102_37s.gif\" alt=\"bar chart\" width=\"350\" height=\"334\" style=\"cursor: pointer;\"></p><p id=\"le2\" class=\"eg_div\"><img src=\"http://web.utk.edu/sas/OnlineTutor/1.2/en/60477/m102/images/m102_37le2s.gif\" alt=\"bar chart\" width=\"350\" style=\"cursor: pointer;\"></p><br><br><br><table width=\"85%\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\"><tbody><tr valign=\"top\"><td style=\"font-size: 13px;\"><p>Using SAS Enterprise Guide, you can create the following types of graphs:</p><ul><li>bar charts</li><li>pie charts</li><li>area charts</li><li>line charts</li><li>scatter charts</li><li>surface charts</li><li>map charts</li><li>bubble plots</li><li>finance charts</li><li>donut charts</li><li>contour plots</li><li>radar (or star) charts.</li></ul><p>For now, you\'ll create a simple bar chart in HTML format. Later in this lesson, you\'ll learn how to use the interactive features of SAS Enterprise Guide graphs and how to insert your graphs into applications such as Microsoft PowerPoint and Microsoft Word.</p></td></tr></tbody></table><p></p><p id=\"eg3\" class=\"eg_div\"></p><table width=\"85%\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\"><tbody><tr valign=\"top\"><td style=\"font-size: 13px;\"><p>Now that you\'ve created a list report, a frequency report, and a summary table, let\'s look at the last type of report that you need: a <b>graph</b> that shows total profit by product category. To create this graph, you can produce a simple bar chart in only a few steps.</p></td></tr></tbody></table><p></p></center>','Y',0,'2014-09-10 16:01:20','นายปิยะพงษ์ แก้วน่าน');

